import React, { Component } from 'react'

export default class nus_background extends Component {
    render() {
        return (
            <footer style ={footStyle}>
                <p>Welcome to NUS</p>
            </footer>
        )
    }
}

const footStyle = {
    color: '#000000',
    textAlign: 'center',
    padding: '10px',
}
